export const Icon: React.FC<IconProps & AllHTMLAttributes<SVGSVGElement>> = (
    props: IconProps & AllHTMLAttributes<SVGSVGElement>,
) => {
    const { name, width = '32', height = '32', color, className = '', ...rest } = props;
    const classNames = classnames({
        [styles[`${color}Color`]]: color,
        [className]: className,
    });
    return (
        <svg {...rest} width={width} height={height} viewBox="0 0 32 32" className={classNames}>
            {getIcon(name)}
        </svg>
    );
};

